import { useEffect,useState } from "react"

const Profile = () => {

    const [token , setToken] = useState('')
    useEffect(() => {
        const token = async () => {
            const res = await fetch('http://localhost:3001/token', {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                }
            })
            const data = await res.json()
            console.log(data)
            setToken(data.token)
        }
        token()
    }, [])


  return (
    <div>
        <h1>Profile</h1>
        {token}
    </div>
  )
}

export default Profile
